FeedPackage.Summary:
Simple to use: 
    1 - instance it -> DataManager DM = new DataManager("dbname", "catalog", "username", "password");
    2 - connect table -> DM.ConnectTable("tablename to connect");// table to connect must have a primary key setted!
    3 - use it -> DataTable res = (DataTable)DM.getAllRecords("table connected").data();
    more in readme file

FeedPackage.Description:
Easy read and write SqlServer tables with Repository Pattern
Easy use:
DataManager DM = new DataManager("dbname", "catalog", "username", "password");
DM.ConnectTable("tablename to connect");// table to connect must have a primary key setted!
DataTable res = (DataTable)DM.getAllRecords("table connected").data();

Easy read and write in your DB
      Simple to use: only 2 lines of code to read and write in SqlServer table!
      DataManager DM = new DataManager("dbname", "catalog", "username", "password");
      DataTable res = DM.getAllRecords("table to read");
      Thats all!
      More here http://MagicData.it/Documentazione/EsempioDataManager
